(371, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:81:\"Scrolling Down the Aisle  10 Wedding Templates That Will Help You Tie the Knot\";s:7:\"excerpt\";s:167:\"In this post, we explore different wedding-themed templates for announcements, photographers, florists and more, all completely responsive and optimized for Elementor.\";s:7:\"created\";s:10:\"1561109283\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/wedding-templates/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:49:\"Monday Masterclass: How to Create Epic Blog Posts\";s:7:\"excerpt\";s:202:\"Simply writing long form content is not enough to create engaging and successful content. In this post, we show how visual elements can compliment your blog posts and improve your readers experience.\";s:7:\"created\";s:10:\"1560790759\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/create-epic-blog-posts/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:65:\"Introducing Hello Theme: The Fastest WordPress Theme Ever Created\";s:7:\"excerpt\";s:183:\"We have finally launched the Hello theme in the WordPress repo. We built Hello so you never have to worry about themes again. Try the theme made by the happy folks at Elementor.\";s:7:\"created\";s:10:\"1558440314\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:123:\"https://elementor.com/blog/introducing-hello-theme/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
