(972, 1, '2019-06-24 08:38:11', '2019-06-24 08:38:11', '<h1>About Us</h1>		\n			<h2>Who We Are</h2>		\n		<p>We believe that fashion should be fun, spontaneous, daring and shared with friends and so we built a new kind of store that Pakistan has never seen before. DNK is not only unique in its product offering but is also revolutionary in terms of operations. Our extraordinary and creative design team is constantly producing new collections. We launch collections on a weekly basis and last but not least, everything we sell is hand-produced once your order is being placed. All of our clothing line is being manufactured in our own factories located in Lahore &amp; Faisalabad. We ship all over Pakistan using cash on delivery method.</p><p>Stay in Touch</p><p>New products will be added on a regular basis so please be sure to like our <a href=\"#\">Facebook </a>page to get notified.</p>		\n			<h3>A few words about</h3>		\n			<h2>Our team</h2>		\n			<figure><img width=\"1045\" height=\"1045\" src=\"http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311.jpg\" alt=\"\" srcset=\"http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311.jpg 1045w, http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311-150x150.jpg 150w, http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311-300x300.jpg 300w, http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311-768x768.jpg 768w, http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311-1024x1024.jpg 1024w, http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311-600x600.jpg 600w, http://localhost/dnk/wp-content/uploads/2019/06/IMG_20180121_172328_311-100x100.jpg 100w\" sizes=\"(max-width: 1045px) 100vw, 1045px\" /></figure><h4>Arsalan Amin</h4><p>Founder - CEO</p>		\n			<h2>Follow Us</h2>		\n							<a href=\"\">\n					Facebook\n				</a>\n							<a href=\"\">\n					Twitter\n				</a>\n							<a href=\"\">\n					Instagram\n				</a>\n							<a href=\"\">\n					Google-plus\n				</a>\n			<figure><img width=\"120\" height=\"120\" src=\"http://localhost/dnk/wp-content/uploads/2019/06/globe-free-img.png\" alt=\"\" srcset=\"http://localhost/dnk/wp-content/uploads/2019/06/globe-free-img.png 120w, http://localhost/dnk/wp-content/uploads/2019/06/globe-free-img-100x100.png 100w\" sizes=\"(max-width: 120px) 100vw, 120px\" /></figure><h4>Worldwide shipping</h4>		\n			<figure><img width=\"120\" height=\"120\" src=\"http://localhost/dnk/wp-content/uploads/2019/06/quality-free-img.png\" alt=\"\" srcset=\"http://localhost/dnk/wp-content/uploads/2019/06/quality-free-img.png 120w, http://localhost/dnk/wp-content/uploads/2019/06/quality-free-img-100x100.png 100w\" sizes=\"(max-width: 120px) 100vw, 120px\" /></figure><h4>Best QUALITY</h4>		\n			<figure><img width=\"120\" height=\"120\" src=\"http://localhost/dnk/wp-content/uploads/2019/06/tag-free-img.png\" alt=\"\" srcset=\"http://localhost/dnk/wp-content/uploads/2019/06/tag-free-img.png 120w, http://localhost/dnk/wp-content/uploads/2019/06/tag-free-img-100x100.png 100w\" sizes=\"(max-width: 120px) 100vw, 120px\" /></figure><h4>Best Offers</h4>		\n			<figure><img width=\"120\" height=\"120\" src=\"http://localhost/dnk/wp-content/uploads/2019/06/lock-free-img.png\" alt=\"\" srcset=\"http://localhost/dnk/wp-content/uploads/2019/06/lock-free-img.png 120w, http://localhost/dnk/wp-content/uploads/2019/06/lock-free-img-100x100.png 100w\" sizes=\"(max-width: 120px) 100vw, 120px\" /></figure><h4>Secure Payments</h4>', 'About', '', 'inherit', 'closed', 'closed', '', '43-revision-v1', '', '', '2019-06-24 08:38:11', '2019-06-24 08:38:11', '', 43, 'http://localhost/dnk/2019/06/24/43-revision-v1/', 0, 'revision', '', 0),
